    private void jButton3ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton3ActionPerformed
        // TODO add your handling code here:
        String firstname,surname,middlename,sex,dob,town,state,birthplace,district,wardname;
        Integer age,houseno,streetno,pincode;
        Integer wardno;     
        firstname=jTextField1.getText();
        surname=jTextField2.getText();
        middlename=jTextField8.getText();
        age=Integer.parseInt(jTextField3.getText());
        
        sex=(String) jComboBox1.getSelectedItem();
        dob=jTextField5.getText();
        birthplace=jTextField6.getText();
        state=(String) jComboBox2.getSelectedItem();
        houseno=Integer.parseInt(jTextField85.getText());
        streetno=Integer.parseInt(jTextField86.getText());
        pincode=Integer.parseInt(jTextField87.getText());
        town=jTextField88.getText();
        district=jTextField89.getText();
        wardno=pincode%100;
        wardname=jTextField88.getText();
        try
        {
            MySqlConnection mysql= new MySqlConnection();
            Connection con = (Connection) mysql.getMySQLConnection();
            
            String query="INSERT INTO voter(firstname,middlename,lastname,sex,dob,age,houseno,streetno,town,state,birthplace,district,pincode)VALUES('"+firstname+"','"+middlename+"','"+surname+"','"+sex+"','"+dob+"','"+age+"','"+houseno+"','"+streetno+"','"+town+"','"+state+"','"+birthplace+"','"+district+"','"+pincode+"') ";
            System.out.println(query);
            PreparedStatement stmt = con.prepareStatement(query);
            stmt.executeUpdate();
            
            String query1="INSERT INTO ward(wardno,wardname)VALUES('"+wardno+"','"+wardname+"')"; 
            System.out.println(query1);
            PreparedStatement stmt1 = con.prepareStatement(query1);
            stmt1.executeUpdate();
            
            
        }
        catch(Exception e)
        {
                e.printStackTrace();
        }
    }//GEN-LAST:event_jButton3ActionPerformed

